css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("youtube.com") {

#video-sidebar,.guide-container{
display:none !important;
}

.feed-item:hover .feed-item-title a{
color:#ddd !important;
}
#feed{
width:1100px !important;
margin-left:0px !important;
}
.feed-item DIV:active a{
background: #111 !important;
}

.feed-item{
background:#111 !important;
}

.feed-item div{
margin-right:15px !important;

}
.feed-container{
background:#111 !important;
color:#ddd !important;
}
.feed-item-title{
background:#222 !important;
color:#fff !important;
}
.feed-item:hover a{
color: #ddd !important;
}
.feed-item a:visited{
color: #ddd !important;
}
}
